class Solution {
    func beautifulSubstrings(_ s: String, _ k: Int) -> Int {
        let vowels = Set("aeiou")
        var result = 0
        let n = s.count
        let sArray = Array(s)

        for i in 0..<n {
            var vowelCount = 0
            var consonantCount = 0
            for j in i..<n {
                if vowels.contains(sArray[j]) {
                    vowelCount += 1
                } else {
                    consonantCount += 1
                }
                if vowelCount == consonantCount && (vowelCount * consonantCount) % k == 0 {
                    result += 1
                }
            }
        }
        return result
    }
}
